import { makeStyles } from "@material-ui/core/styles";

const styles = makeStyles(theme => ({
  root: {
    display: "flex"
  },
  footer: {
    textAlign: "center",
    padding: "20px 5px",
    backgroundColor: "#fff",
    borderTop: "1px solid #f5f5f5"
  }
}));

export default styles;
